import React, { useState, useEffect, useCallback } from "react";
import styled from "styled-components";
import Header from "../components/Header";
import Sidebar from "../components/Sidebar";
import PostCard from "../components/PostCard";
import { useParams } from "react-router-dom";

const PageLayout = styled.div`
  display: flex;
  min-height: 100vh;
`;

const MainContent = styled.main`
  flex-grow: 1;
  padding: 20px;
  background-color: #f5f5f5;
`;

const PostGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
  gap: 20px;
`;

const Country = styled.div`
  color: #333;
  margin: 0;
  font-size: 24px;
  font-weight: bold;
`;

const FilterButtons = styled.div`
  margin-bottom: 20px;
`;

const FilterButton = styled.button`
  margin-right: 10px;
  padding: 5px 10px;
  background-color: ${(props) => (props.active ? "#FFD43B" : "#f8f9fa")};
  color: ${(props) => (props.active ? "white" : "black")};
  border: 1px solid #ffd43b;
  border-radius: 5px;
  cursor: pointer;

  &:hover {
    background-color: #ffd43b;
    color: white;
  }
`;

const CommunityPage = () => {
  const { category } = useParams();
  const text = category || "";
  const [posts, setPosts] = useState([]);
  const [sortBy, setSortBy] = useState("likes");
  const [selectedCountry, setSelectedCountry] = useState(null);

  const countryInfo = {
    canada: { korName: "Ï∫êÎÇòÎã§", flag: "üá®üá¶" },
    australia: { korName: "Ìò∏Ï£º", flag: "üá¶üá∫" },
    newzealand: { korName: "Îâ¥ÏßàÎûúÎìú", flag: "üá≥üáø" },
    england: { korName: "ÏòÅÍµ≠", flag: "üá¨üáß" },
    netherlands: { korName: "ÎÑ§ÎçúÎûÄÎìú", flag: "üá≥üá±" },
    germany: { korName: "ÎèÖÏùº", flag: "üá©üá™" },
  };

  const fetchPosts = useCallback(async () => {
    try {
      const response = await axios.get('/api/posts'); // Ïã§Ï†ú API ÏóîÎìúÌè¨Ïù∏Ìä∏Î°ú Î≥ÄÍ≤ΩÌïòÏÑ∏Ïöî
      return response.data;
    } catch (error) {
      console.error('Error fetching posts:', error);
      return [];
    }
  }, []);

  useEffect(() => {
    const fetchAndSetPosts = async () => {
      const fetchedPosts = await fetchPosts();
      setPosts(fetchedPosts);
    };
    fetchAndSetPosts();
  }, [fetchPosts]);

  const sortPosts = useCallback(
    (postsToSort) => {
      return [...postsToSort].sort((a, b) => {
        if (sortBy === "likes") {
          return b.likes - a.likes;
        } else {
          return new Date(b.date) - new Date(a.date);
        }
      });
    },
    [sortBy]
  );

  useEffect(() => {
    setPosts((prevPosts) => sortPosts(prevPosts));
  }, [sortBy, sortPosts]);

  const handleSortChange = (newSortBy) => {
    setSortBy(newSortBy);
  };

  const handleCountrySelect = (country) => {
    setSelectedCountry(country);
  };

  const filteredPosts = selectedCountry
    ? posts.filter((post) => post.country === selectedCountry)
    : posts;

  return (
    <>
      <Header />
      <PageLayout>
        <Sidebar text={text} />
        <MainContent>
          <h1>Ïª§ÎÆ§ÎãàÌã∞</h1>
          <div>
            {Object.entries(countryInfo).map(([code, info]) => (
              <FilterButton
                key={code}
                onClick={() => handleCountrySelect(code)}
                active={selectedCountry === code}
              >
                {info.flag} {info.korName}
              </FilterButton>
            ))}
            <FilterButton
              onClick={() => setSelectedCountry(null)}
              active={selectedCountry === null}
            >
              Ï†ÑÏ≤¥
            </FilterButton>
          </div>
          <div>
            <FilterButton
              onClick={() => handleSortChange("likes")}
              active={sortBy === "likes"}
            >
              Ïù∏Í∏∞Ïàú
            </FilterButton>
            <FilterButton
              onClick={() => handleSortChange("date")}
              active={sortBy === "date"}
            >
              ÏµúÏã†Ïàú
            </FilterButton>
          </div>
          <PostGrid>
            {filteredPosts.map((post) => (
              <PostCard
                key={post.id}
                title={post.title}
                likes={post.likes}
                author={post.author}
                date={post.date}
                preview={post.preview}
              />
            ))}
          </PostGrid>
        </MainContent>
      </PageLayout>
    </>
  );
};

export default CommunityPage;
